import React from 'react';
import {Text, View, StyleSheet} from 'react-native';

export function Breadcrumb({name}) {
    const navigation = useNavigation();
  return (
    // <View style={styles.breadcrumbCntr}><Text style={styles.breadcrumbTitle}>Home > {name}</Text></View>
    <View style={styles.breadcrumbCntr}>
    <Text>
        <Text 
            onPress={() => { 
                navigation.navigate('Shopping_Cart');
            }}
        >
        {'Home'}
        </Text>
        <Text>{name}</Text>
    </Text>
    </View>
  );
}

const styles = StyleSheet.create({
    breadcrumbCntr: {
        backgroundColor: '#ffffff',
        paddingLeft: 22,
        paddingRight: 22,
        paddingBottom: 10,
        paddingTop: 10,
        borderRadius: 4,
        margin: 10
      },
      breadcrumbTitle: {
        fontSize: 16,
        color: '#666666',
        fontWeight: 'bold',
        fontFamily: 'arial',
      }
});
